import React from 'react'
import ApiPrice from './components/ApiPrice'
import ApiTicker from './components/ApiTicker'


function App() {
  return (
    <div className="App">
      <ApiTicker />
      <ApiPrice price = {this.state}/>
    </div>
  );
}

export default App;
